import React from 'react';
import MyGoogleMap from '../components/UI/GoogleMap/MyGoogleMap';

const About = () => {
    return (
        <MyGoogleMap>
            containerElement={
                <div style = {{height: '100%'}}></div>
            }
            mapElement={
                <div style = {{height: '100%'}}></div>
            }
        </MyGoogleMap>
    );
};

export default About;
